has 'day_period_data' => (
	traits		=> ['Code'],
	is			=> 'ro',
	isa			=> 'CodeRef',
	init_arg	=> undef,
	handles		=> { call => 'execute_method' },
	default		=> sub { sub {
		# Time in hhmm format
		my ($self, $type, $time) = @_;
		SWITCH:
		for ($type) {
			if ($_ eq 'hebrew') {
				return 'night' if $time >= 0000
					&& $time < 300;
				return 'morning' if $time >= 300
					&& $time < 1200;
				return 'evening' if $time >= 1700
					&& $time < 2400;
				return 'afternoon' if $time >= 1200
					&& $time < 1700;
			last SWITCH;
			}
			if ($_ eq 'gregorian') {
				return 'night' if $time >= 0000
					&& $time < 300;
				return 'morning' if $time >= 300
					&& $time < 1200;
				return 'evening' if $time >= 1700
					&& $time < 2400;
				return 'afternoon' if $time >= 1200
					&& $time < 1700;
			last SWITCH;
			}
			if ($_ eq 'ethiopic') {
				return 'night' if $time >= 0000
					&& $time < 300;
				return 'morning' if $time >= 300
					&& $time < 1200;
				return 'evening' if $time >= 1700
					&& $time < 2400;
				return 'afternoon' if $time >= 1200
					&& $time < 1700;
			last SWITCH;
			}
			if ($_ eq 'indian') {
				return 'night' if $time >= 0000
					&& $time < 300;
				return 'morning' if $time >= 300
					&& $time < 1200;
				return 'evening' if $time >= 1700
					&& $time < 2400;
				return 'afternoon' if $time >= 1200
					&& $time < 1700;
			last SWITCH;
			}
			if ($_ eq 'islamic') {
				return 'night' if $time >= 0000
					&& $time < 300;
				return 'morning' if $time >= 300
					&& $time < 1200;
				return 'evening' if $time >= 1700
					&& $time < 2400;
				return 'afternoon' if $time >= 1200
					&& $time < 1700;
			last SWITCH;
			}
			if ($_ eq 'coptic') {
				return 'night' if $time >= 0000
					&& $time < 300;
				return 'morning' if $time >= 300
					&& $time < 1200;
				return 'evening' if $time >= 1700
					&& $time < 2400;
				return 'afternoon' if $time >= 1200
					&& $time < 1700;
			last SWITCH;
			}
			if ($_ eq 'persian') {
				return 'night' if $time >= 0000
					&& $time < 300;
				return 'morning' if $time >= 300
					&& $time < 1200;
				return 'evening' if $time >= 1700
					&& $time < 2400;
				return 'afternoon' if $time >= 1200
					&& $time < 1700;
			last SWITCH;
			}
			if ($_ eq 'japanese') {
				return 'night' if $time >= 0000
					&& $time < 300;
				return 'morning' if $time >= 300
					&& $time < 1200;
				return 'evening' if $time >= 1700
					&& $time < 2400;
				return 'afternoon' if $time >= 1200
					&& $time < 1700;
			last SWITCH;
			}
			if ($_ eq 'generic') {
				return 'night' if $time >= 0000
					&& $time < 300;
				return 'morning' if $time >= 300
					&& $time < 1200;
				return 'evening' if $time >= 1700
					&& $time < 2400;
				return 'afternoon' if $time >= 1200
					&& $time < 1700;
			last SWITCH;
			}
		}
	} },
);

